import React from 'react';

function SpecialSingle({title, description, image}) {
  return (
   <article className='special'>
    <img className={"special-image"} src={image} style={{ width: "100%" }} />
    <h3>{title}</h3>
    <p>{description}</p>

   </article>
  );
}

export default SpecialSingle;
